import React from "react";
import InstagramEmbed from "react-instagram-embed";
import Carousel from "react-bootstrap/Carousel";

const list = [
  {
    Cliente: "Villas del María",
    fuente: "https://www.instagram.com/p/B7pJj5Dhwjs/"
  },
  {
    Cliente: "Villas del María",
    fuente: "https://www.instagram.com/p/B7XB2lqBNdx/"
  },
  {
    Cliente: "Villas del María",
    fuente: "https://www.instagram.com/p/B7pJj5Dhwjs/"
  },
  {
    Cliente: "Villas del María",
    fuente: "https://www.instagram.com/p/B7XB2lqBNdx/"
  }
];
export default class instagram extends React.Component {
  render() {
    const { column } = this.props;
    return (
      <div>
        <React.Fragment>
          <Carousel fade="true" width="320">
            {list.map((val, i) => (
              <Carousel.Item>
                <InstagramEmbed
                  url={val.fuente}
                  maxWidth={320}
                  hideCaption={true}
                  containerTagName="URL"
                  protocol=""
                  injectScript
                  onLoading={() => {}}
                  onSuccess={() => {}}
                  onAfterRender={() => {}}
                  onFailure={() => {}}
                />
              </Carousel.Item>
            ))}
          </Carousel>
        </React.Fragment>
      </div>
    );
  }
}
